window.bookSummaryJSON = "<p>Mankind's outer colonies are disappearing. Without warning. Without a trace. Fleet command chalks the attacks up to pirates, but Captain Dryker of the UFC Johnston isn't buying it. </p> <p>Defying command, he leads his misfit crew into hostile territory in search of answers. They encounter the mythical Void Wraith, an unstoppable legend whispered by the first race. After 26,000 years, the Void Wraith have returned to begin the next Eradication. Their technology is superior, their motives unclear. </p> <p>Humanity cannot stop them. Not without help. Captain Dryker's only hope is to forge an alliance with mankind's greatest enemy, the savage Tigris. </p> <p>One maverick captain, an unlikely crew, and an aging vessel are all that stand between humanity and the Eradication. </p> <p>\"It's like <i>Battlestar Galactica</i> and <i>Mass Effect</i> had a baby, and that baby was raised by <i>StarCraft</i>. I read this book in one sitting and immediately looked for the next.\" (The author's totally biased friend) </p> <p>Contains the Complete Trilogy: </p> <p></p> <ul> <li><i>Destroyer </i></li> <li><i>Void Wraith </i></li> <li><i>Eradication </i></li> </ul> <p></p>"; 
